import logo from "../../assets/pokemonLogo.svg";
import { HeaderContainer, ButtonGoToPage, ButtonReturnPage } from "./style";

function Header({ headerProps }) {
  const {
    page,
    buttonFunction,
    textButton,
    buttonFunctionDelete,
    textButtonDelete,
  } = headerProps;
  return (
    <HeaderContainer>
      {page !== "pokemonsList" && (
        <ButtonReturnPage onClick={buttonFunction}>
          {textButton}
        </ButtonReturnPage>
      )}
      <img src={logo} alt="" />
      {page !== "pokedex" && (
        <ButtonGoToPage onClick={buttonFunction}>{textButton}</ButtonGoToPage>
      )}
    </HeaderContainer>
  );
}
export default Header;
